CREATE TABLE SGDTEST.COR_AGENTE
(
    IDE_AGENTE NUMBER(18) PRIMARY KEY NOT NULL,
    IDE_DOCUMENTO NUMBER(18),
    COD_TIPO_REMITE VARCHAR2(8) DEFAULT NULL
,
    COD_TIPO_PERS VARCHAR2(8) DEFAULT NULL
,
    NOMBRE VARCHAR2(100) DEFAULT NULL
,
    RAZON_SOCIAL VARCHAR2(150) DEFAULT NULL
,
    NIT VARCHAR2(16) DEFAULT NULL
,
    COD_CORTESIA VARCHAR2(8) DEFAULT NULL
,
    COD_EN_CALIDAD VARCHAR2(8) DEFAULT NULL
,
    COD_TIP_DOC_IDENT VARCHAR2(8) DEFAULT NULL
,
    NRO_DOCU_IDENTIDAD VARCHAR2(250) DEFAULT NULL
,
    COD_SEDE VARCHAR2(8) DEFAULT NULL
,
    COD_DEPENDENCIA VARCHAR2(8) DEFAULT NULL
,
    COD_ESTADO VARCHAR2(8) DEFAULT NULL
,
    FEC_ASIGNACION TIMESTAMP(6) DEFAULT NULL
,
    COD_TIP_AGENT VARCHAR2(8) DEFAULT NULL
,
    IND_ORIGINAL VARCHAR2(20),
    FEC_CREACION TIMESTAMP(6) NOT NULL,
    ESTADO_DISTRIBUCION VARCHAR2(8)
);
COMMENT ON COLUMN SGDTEST.COR_AGENTE.IND_ORIGINAL IS 'Indica si el destinatario es original o copia';
